import { Component, EventEmitter, Input, OnInit, Output } from '@angular/core';
import { Ns2HttpService } from 'app/shared/service/ns2-http.service';
import { DateUtilsService } from 'app/core/util/date-utils.service';
import { ExportUtilsService } from 'app/core/util/export-utils.service';
import { EnquiryNSmanService } from 'app/enquiry/nsman/service/enquiry-nsman.service';
import { PrepopEclaimRecord } from 'app/enquiry/nsman/model/claims-related.model';
import { NSmanPersonalInfo } from 'app/enquiry/nsman/model/nsman.model';
import { Table } from 'primeng/table';

@Component({
  selector: 'n2-nsman-eclaim-record',
  templateUrl: './nsman-eclaim-record.component.html',
  styleUrls: ['./nsman-eclaim-record.component.scss']
})
export class NsmanEclaimRecordComponent implements OnInit {

  @Input() callUpId: string;
  @Input() nsmanInfo: NSmanPersonalInfo;
  @Output() recordClose: EventEmitter<void> = new EventEmitter<void>();

  displayCabDialog: any = { display: false };

  placeholder = [{ pTableNeedsThisToDisplayData: "" }];

  isHalfDay = false;
  isSingleDay = false;
  natureOfTrade: any[] = [];
  formBNatureOfTrade: any[] = [];
  eClaimRecord: PrepopEclaimRecord;

  // cab variable
  csnOrNric = '';

  constructor(
    private ns2HttpService: Ns2HttpService,
    private dateUtilsService: DateUtilsService,
    private exportUtilsService: ExportUtilsService,
    private enquiryNSmanService: EnquiryNSmanService,
  ) {}

  ngOnInit(): void {
    this.retrievePrepopEclaim();
  }

  retrievePrepopEclaim(): void {
    this.enquiryNSmanService.getPrepopEclaimRecord(this.callUpId).subscribe(resp => {
      if (resp.body?.data) {
        this.eClaimRecord = resp.body.data;
        console.log("eClaim Record", this.eClaimRecord);
      }
    });
    setTimeout(() => {
      this.initIndicators();
      this.initNatureOfTrade();
    }, 1000);
  }

  initIndicators(): void {
    this.isHalfDay = this.eClaimRecord?.halfDayInd === 'Y';
    this.isSingleDay = this.eClaimRecord?.singleDayInd === 'Y';
  }

  initNatureOfTrade(): void {
    this.natureOfTrade = Object.entries(this.eClaimRecord.seTableDto.natureOfTrade);
    this.formBNatureOfTrade = Object.entries(this.eClaimRecord.seTableDto.formBNatureOfTrade);
  }

  onOpenCabDialog(csnOrNric: string): void {
    this.csnOrNric = csnOrNric;
    this.displayCabDialog.display = true;
  }

  onCloseDialog(dialog: any): void {
    dialog.display = false;
  }

  exportEcTableCSV(dataTable: Table, index: number): void {
    const ecTable = this.eClaimRecord.ecTableDtos.at(index);
    if (ecTable != null) {
      const columns = [
        { field: 'csn', header: 'CSN', index: 0 },
        { field: 'companyName', header: 'Company Name', index: 1 },
        { field: 'sentOn', header: 'Sent On', index: 2 },
        { field: 'status', header: 'Status', index: 3 },
        { field: 'workHour', header: 'Work Hour', index: 4 },
        { field: 'formula', header: 'Formula', index: 5 },
        { field: 'payPeriodStart', header: 'Pay Period Start', index: 6 },
        { field: 'nonWorkingDay', header: 'Non-working Day', index: 7 },
        { field: 'cpfRefMonth', header: 'CPF Ref. Month', index: 8 },
        { field: 'ow', header: 'OW', index: 9 },
        { field: 'aw', header: 'AW', index: 10 },
        { field: 'awDivisor', header: 'AW Divisor', index: 11 },
        { field: 'computedAmt', header: 'Computed Amt', index: 12 },
      ];

      const dtoList: any[] = [];

      const details = {
        csn: ecTable.csn,
        companyName: ecTable.companyName,
        sentOn: `${String(this.dateUtilsService.formatStrDate(ecTable.sentOn, "DD-MM-YYYY"))}`,
        status: ecTable.status,
        workHour: this.isSingleDay ? `${String(ecTable.workHourStart)} to ${String(ecTable.workHourEnd)} | ${ecTable.referenceCaseId}` : '',
        formula: `${ecTable.formulaCode} ${ecTable.formulaDesc} | ${ecTable.referenceCaseId}`,
        payPeriodStart: ecTable.payPeriodStartDate,
        nonWorkingDay: ecTable.nonWorkingDay,
        cpfRefMonth: `${String(this.dateUtilsService.formatStrDate(ecTable.cpfRefMonth, "MM-YYYY"))}`,
        ow: `${String(ecTable.owAmt)} | ${ecTable.owComputation}`,
        aw: `${String(ecTable.awAmt)} | ${ecTable.awComputation}`,
        awDivisor: ecTable.awDivisor,
        computedAmt: ecTable.computedAmt,
      }
      dtoList.push(details);

      const cpfBreakdown = {
        csn: 'CPF Breakdown',
      }
      dtoList.push(cpfBreakdown);

      const cpfMonths = {
        csn: 'Month',
        companyName: `${String(this.dateUtilsService.formatStrDate(ecTable.cpfBreakdown.at(0).refMonth, "MM-YYYY"))}`,
        sentOn: `${String(this.dateUtilsService.formatStrDate(ecTable.cpfBreakdown.at(1).refMonth, "MM-YYYY"))}`,
        status: `${String(this.dateUtilsService.formatStrDate(ecTable.cpfBreakdown.at(2).refMonth, "MM-YYYY"))}`,
        workHour: `${String(this.dateUtilsService.formatStrDate(ecTable.cpfBreakdown.at(3).refMonth, "MM-YYYY"))}`,
        formula: `${String(this.dateUtilsService.formatStrDate(ecTable.cpfBreakdown.at(4).refMonth, "MM-YYYY"))}`,
        payPeriodStart: `${String(this.dateUtilsService.formatStrDate(ecTable.cpfBreakdown.at(5).refMonth, "MM-YYYY"))}`,
        nonWorkingDay: `${String(this.dateUtilsService.formatStrDate(ecTable.cpfBreakdown.at(6).refMonth, "MM-YYYY"))}`,
        cpfRefMonth: `${String(this.dateUtilsService.formatStrDate(ecTable.cpfBreakdown.at(7).refMonth, "MM-YYYY"))}`,
        ow: `${String(this.dateUtilsService.formatStrDate(ecTable.cpfBreakdown.at(8).refMonth, "MM-YYYY"))}`,
        aw: `${String(this.dateUtilsService.formatStrDate(ecTable.cpfBreakdown.at(9).refMonth, "MM-YYYY"))}`,
        awDivisor: `${String(this.dateUtilsService.formatStrDate(ecTable.cpfBreakdown.at(10).refMonth, "MM-YYYY"))}`,
        computedAmt: `${String(this.dateUtilsService.formatStrDate(ecTable.cpfBreakdown.at(11).refMonth, "MM-YYYY"))}`,
      }
      dtoList.push(cpfMonths);

      const owValues = {
        csn: 'OW',
        companyName: ecTable.cpfBreakdown.at(0).ow,
        sentOn: ecTable.cpfBreakdown.at(1).ow,
        status: ecTable.cpfBreakdown.at(2).ow,
        workHour: ecTable.cpfBreakdown.at(3).ow,
        formula: ecTable.cpfBreakdown.at(4).ow,
        payPeriodStart: ecTable.cpfBreakdown.at(5).ow,
        nonWorkingDay: ecTable.cpfBreakdown.at(6).ow,
        cpfRefMonth: ecTable.cpfBreakdown.at(7).ow,
        ow: ecTable.cpfBreakdown.at(8).ow,
        aw: ecTable.cpfBreakdown.at(9).ow,
        awDivisor: ecTable.cpfBreakdown.at(10).ow,
        computedAmt: ecTable.cpfBreakdown.at(11).ow,
      }
      dtoList.push(owValues);

      const awValues = {
        csn: 'AW',
        companyName: ecTable.cpfBreakdown.at(0).aw,
        sentOn: ecTable.cpfBreakdown.at(1).aw,
        status: ecTable.cpfBreakdown.at(2).aw,
        workHour: ecTable.cpfBreakdown.at(3).aw,
        formula: ecTable.cpfBreakdown.at(4).aw,
        payPeriodStart: ecTable.cpfBreakdown.at(5).aw,
        nonWorkingDay: ecTable.cpfBreakdown.at(6).aw,
        cpfRefMonth: ecTable.cpfBreakdown.at(7).aw,
        ow: ecTable.cpfBreakdown.at(8).aw,
        aw: ecTable.cpfBreakdown.at(9).aw,
        awDivisor: ecTable.cpfBreakdown.at(10).aw,
        computedAmt: ecTable.cpfBreakdown.at(11).aw,
      }
      dtoList.push(awValues);

      this.exportUtilsService.exportCSV(dataTable, dtoList, dtoList.length, columns, "Prepopulated EClaim Record EC Table");
    }
  }

  exportSeTableCSV(dataTable: Table): void {
    const seTable = this.eClaimRecord.seTableDto;
    if (seTable != null) {
      const natureOfTrade: any[] = [];
      const formBNatureOfTrade: any[] = [];
      this.natureOfTrade.forEach(x => {
        natureOfTrade.push(x.at(0).concat(' ', x.at(1)));
      });
      this.formBNatureOfTrade.forEach(x => {
        formBNatureOfTrade.push(x.at(0).concat(' ', x.at(1)));
      });

      const columns = [
        { field: 'sentOn', header: 'Sent On', index: 0 },
        { field: 'status', header: 'Status', index: 1 },
        { field: 'commencementDate', header: 'Commencement Date', index: 2 },
        { field: 'occupation', header: 'Occupation', index: 3 },
        { field: 'workHour', header: 'Work Hour', index: 4 },
        { field: 'formulaCode', header: 'Formula Code', index: 5 },
        { field: 'yearlyIncome', header: 'Yearly Income', index: 6 },
        { field: 'divisor', header: 'Divisor', index: 7 },
        { field: 'dailyIncome', header: 'Daily Income', index: 8 },
        { field: 'computationString', header: 'Computation String', index: 9 },
        { field: 'computedAmt', header: 'Computed Amt', index: 10 },
      ];

      const dtoList: any[] = [];

      const details = {
        sentOn: `${String(this.dateUtilsService.formatStrDate(seTable.sentOn, "DD-MM-YYYY"))}`,
        status: seTable.status,
        commencementDate: `${String(this.dateUtilsService.formatStrDate(seTable.commencementDate, 
          "DD-MM-YYYY"))} | ${seTable.referenceCaseId}`,
        occupation: `${seTable.occupation} | ${seTable.referenceCaseId}`,
        workHour: `0001 to 2359`,
        formulaCode: `${seTable.formulaCode} ${seTable.formulaDesc} | ${seTable.referenceCaseId}`,
        yearlyIncome: seTable.yearlyIncome,
        divisor: seTable.divisor,
        dailyIncome: seTable.dailyIncome,
        computationString: seTable.computationString,
        computedAmt: seTable.computedAmt,
      }
      dtoList.push(details);

      const noa = {
        sentOn: `NOA ${String(seTable.noaYear).substring(2)} (Retrieved on ${String(this.dateUtilsService.formatStrDate
          (seTable.irasRetrievalDate, "DD-MM-YYYY"))})`,
      }
      dtoList.push(noa);

      const noaHeaders = {
        sentOn: 'NOA',
        status: 'Income Year',
        commencementDate: 'Trade Income',
        occupation: 'Emp. Income',
        workHour: 'Nett Emp. Income',
        formulaCode: 'Occupation',
        yearlyIncome: 'Form B Revenue',
        divisor: 'Form B Nett Trade',
        dailyIncome: 'Form B Occupation',
        computationString: 'Form B Acc. Period',
      }
      dtoList.push(noaHeaders);

      const noaValues = {
        sentOn: seTable.noaYear,
        status: seTable.incomeYear,
        commencementDate: seTable.tradeIncome,
        occupation: seTable.employmentIncome,
        workHour: seTable.nettEmploymentIncome,
        formulaCode: natureOfTrade.toString(),
        yearlyIncome: seTable.formBRevenue,
        divisor: seTable.formBNettTrade,
        dailyIncome: formBNatureOfTrade.toString(),
        computationString: seTable.formBAccountingPeriod,
      }
      dtoList.push(noaValues);

      this.exportUtilsService.exportCSV(dataTable, dtoList, dtoList.length, columns, "Prepopulated EClaim Record SE Table");
    }
  }

  close(): void {
    this.recordClose.emit();
  }

}
<div *ngIf="eClaimRecord != null">
    <div style="padding-top: 1rem; padding-bottom: 1rem;">
        <button pButton pRipple type="button" icon="pi pi-times" (click)="close()" [style]="{'float':'right'}"
            class="p-button-rounded p-button-primary p-button-text"></button>
        <div>
            <b>{{ nsmanInfo.nric }} {{ nsmanInfo.rank }} {{ nsmanInfo.fullName }}</b>
        </div>
        <div *ngIf="isSingleDay; else multiDay">
            Call-up: <b>{{ eClaimRecord.callUpStartDt | date:'dd-MM-yyyy' }}
            ({{ eClaimRecord.callUpStartDt | date:'HHmm' }} - {{ eClaimRecord.callUpEndDt | date:'HHmm' }})
            {{ eClaimRecord.callUpStartDt | date:'E' }}</b>
            <b style="margin-left: 2rem;">{{ eClaimRecord.trgCode }}</b>
            <span style="margin-left: 2rem;">Half-day Indicator:</span>
            <p-checkbox [(ngModel)]="isHalfDay" [binary]="true" [disabled]="true"></p-checkbox>
        </div>
        <ng-template #multiDay>
            <div>
                Call-up: <b>{{ eClaimRecord.callUpStartDt | date:'dd-MM-yyyy (HHmm) E' }} to {{ eClaimRecord.callUpEndDt | date:'dd-MM-yyyy (HHmm) E' }}</b>
                <b style="margin-left: 2rem;">{{ eClaimRecord.trgCode }}</b>
            </div>
        </ng-template>
    </div>

    <div *ngFor="let ecTableDto of eClaimRecord.ecTableDtos; let i = index">
        <p-table #ecTable [value]="placeholder" styleClass="p-datatable-gridlines" class="table-margin">
            <ng-template pTemplate="caption">
                <div style="display: flex; align-items: center">
                    <button type="button" pButton pRipple icon="pi pi-file" (click)="exportEcTableCSV(ecTable, i)" pTooltip="Export as CSV"
                    tooltipPosition="bottom"></button>
                    <span style="margin-left: 1rem; font-weight: bold;">
                        {{ ecTableDto.csn }} {{ ecTableDto.companyName }}
                    </span>
                    <span style="margin-left: 4rem;">
                        Sent on:
                        <b *ngIf="ecTableDto.sentOn != '0'">{{ ecTableDto.sentOn | date:'dd-MM-yyyy' }}</b>
                    </span>
                    <span style="margin-left: 2rem;">
                        Status: <b>{{ ecTableDto.status }}</b>
                        (<a href="javascript:" (click)="onOpenCabDialog(ecTableDto.csn)"
                        [ngClass]="ecTableDto.employerBlockInd == 'Y' ? 'highlight-red' : null">Company CAB</a>,
                        <a href="javascript:" (click)="onOpenCabDialog(nsmanInfo.nric)"
                        [ngClass]="ecTableDto.nsmanBlockInd == 'Y' ? 'highlight-red' : null">NSman CAB</a>)
                    </span>
                </div>
            </ng-template>
            <ng-template pTemplate="header">
                <tr>
                    <th scope="col" colspan="2">Work hour</th>
                    <th scope="col" colspan="2">Formula</th>
                    <th scope="col">Pay Period Start</th>
                    <th scope="col">Non-working Day</th>
                    <th scope="col">CPF Ref. Month</th>
                    <th scope="col" colspan="2">OW</th>
                    <th scope="col" colspan="2">AW</th>
                    <th scope="col">AW Divisor</th>
                    <th scope="col">Computed Amt</th>
                </tr>
            </ng-template>
            <ng-template pTemplate="body">
                <tr>
                    <td colspan="2">
                        <span *ngIf="isSingleDay">{{ ecTableDto.workHourStart }} to {{ ecTableDto.workHourEnd }}</span>
                        <br>
                        <span *ngIf="isSingleDay">&lt;{{ ecTableDto.referenceCaseId }}&gt;</span>
                    </td>
                    <td colspan="2">
                        {{ ecTableDto.formulaCode }} {{ ecTableDto.formulaDesc }}
                        <br>
                        &lt;{{ ecTableDto.referenceCaseId }}&gt;
                    </td>
                    <td>{{ ecTableDto.payPeriodStartDate }}</td>
                    <td>{{ ecTableDto.nonWorkingDay }}</td>
                    <td>{{ ecTableDto.cpfRefMonth | date:'MM-yyyy' }}</td>
                    <td colspan="2" style="text-align: right">
                        {{ ecTableDto.owAmt | currency:'SGD' : '' }}
                        <br>
                        {{ ecTableDto.owComputation }}
                    </td>
                    <td colspan="2" style="text-align: right">
                        {{ ecTableDto.awAmt | currency:'SGD' : '' }}
                        <br>
                        {{ ecTableDto.awComputation }}
                    </td>
                    <td>{{ ecTableDto.awDivisor }}</td>
                    <td>{{ ecTableDto.computedAmt | currency:'SGD' : '' }}</td>
                </tr>
                <tr>
                    <th scope="colgroup" colspan="13" class="custom-column-header">CPF Breakdown</th>
                </tr>
                <tr>
                    <th scope="row" class="custom-column-header-horizontal">Month</th>
                    <td *ngFor="let cpf of ecTableDto.cpfBreakdown" [ngClass]="cpf.precedingYearInd === 'Y' ? 'yellow-bg' : 'blue-bg' ">
                        {{ cpf.refMonth | date:'MM-yyyy' }}
                    </td>
                </tr>
                <tr>
                    <th scope="row" class="custom-column-header-horizontal">OW</th>
                    <td *ngFor="let cpf of ecTableDto.cpfBreakdown">
                        {{ cpf.ow }}
                    </td>
                </tr>
                <tr>
                    <th scope="row" class="custom-column-header-horizontal">AW</th>
                    <td *ngFor="let cpf of ecTableDto.cpfBreakdown">
                        {{ cpf.aw }}
                    </td>
                </tr>
            </ng-template>
        </p-table>
    </div>

    <p-table #seTable [value]="placeholder" styleClass="p-datatable-gridlines" class="table-margin">
        <ng-template pTemplate="caption">
            <div style="display: flex; align-items: center">
                <button type="button" pButton pRipple icon="pi pi-file" (click)="exportSeTableCSV(seTable)" pTooltip="Export as CSV"
                tooltipPosition="bottom"></button>
                <span style="margin-left: 1rem; font-weight: bold;">Self-Employed (Income Tax)</span>
                <span style="margin-left: 4rem;">
                    Sent on:
                    <b *ngIf="eClaimRecord.seTableDto.sentOn != '0'">{{ eClaimRecord.seTableDto.sentOn | date:'dd-MM-yyyy' }}</b>
                </span>
                <span style="margin-left: 2rem;">
                    Status: <b>{{ eClaimRecord.seTableDto.status }}</b>
                    (<a href="javascript:" (click)="onOpenCabDialog(nsmanInfo.nric)"
                    [ngClass]="eClaimRecord.seTableDto.nsmanBlockInd == 'Y' ? 'highlight-red' : null">NSman CAB</a>)
                </span>
            </div>
        </ng-template>
        <ng-template pTemplate="header">
            <tr>
                <th scope="col" colspan="2">Commencement Date</th>
                <th scope="col">Occupation</th>
                <th scope="col">Work hour</th>
                <th scope="col">Formula Code</th>
                <th scope="col">Yearly Income</th>
                <th scope="col">Divisor</th>
                <th scope="col">Daily Income</th>
                <th scope="col">Computation String</th>
                <th scope="col">Computed Amt</th>
            </tr>
        </ng-template>
        <ng-template pTemplate="body" let-record let-i="rowIndex">
            <tr>
                <td colspan="2">
                    {{ eClaimRecord.seTableDto.commencementDate }}
                    <br>
                    &lt;{{ eClaimRecord.seTableDto.referenceCaseId }}&gt;
                </td>
                <td>
                    {{ eClaimRecord.seTableDto.occupation }}
                    <br>
                    &lt;{{ eClaimRecord.seTableDto.referenceCaseId }}&gt;
                </td>
                <td>0001 to 2359</td>
                <td>
                    {{ eClaimRecord.seTableDto.formulaCode }} {{ eClaimRecord.seTableDto.formulaDesc }}
                    <br>
                    &lt;{{ eClaimRecord.seTableDto.referenceCaseId }}&gt;
                </td>
                <td>{{ eClaimRecord.seTableDto.yearlyIncome | currency:'SGD' : '' }}</td>
                <td>{{ eClaimRecord.seTableDto.divisor }}</td>
                <td>{{ eClaimRecord.seTableDto.dailyIncome | currency:'SGD' : '' }}</td>
                <td>{{ eClaimRecord.seTableDto.computationString }}</td>
                <td>{{ eClaimRecord.seTableDto.computedAmt | currency:'SGD' : '' }}</td>
            </tr>
            <tr>
                <th scope="colgroup" colspan="10" class="custom-column-header">NOA
                    {{ eClaimRecord.seTableDto.noaYear.toString().substring(2) }}
                    (Retrieved on {{ eClaimRecord.seTableDto.irasRetrievalDate }})
                </th>
            </tr>
            <tr>
                <th scope="col" rowspan="2" class="custom-column-header">NOA</th>
                <th scope="col" rowspan="2" class="custom-column-header">Income Year</th>
                <th scope="col" rowspan="2" class="custom-column-header">Trade Income</th>
                <th scope="col" rowspan="2" class="custom-column-header">Emp. Income</th>
                <th scope="col" rowspan="2" class="custom-column-header">Nett Emp. Income</th>
                <th scope="col" rowspan="2" class="custom-column-header">Occupation</th>
                <th rowspan="1" colspan="4" scope="colgroup" class="custom-column-header">Form B</th>
            </tr>
            <tr>
                <th scope="col" class="custom-column-header">Revenue</th>
                <th scope="col" class="custom-column-header">Nett Trade</th>
                <th scope="col" class="custom-column-header">Occupation</th>
                <th scope="col" class="custom-column-header">Acc. Period</th>
            </tr>
            <tr>
                <td>{{ eClaimRecord.seTableDto.noaYear }}</td>
                <td>{{ eClaimRecord.seTableDto.incomeYear }}</td>
                <td>{{ eClaimRecord.seTableDto.tradeIncome | currency:'SGD' : '' }}</td>
                <td>{{ eClaimRecord.seTableDto.employmentIncome | currency:'SGD' : '' }}</td>
                <td>{{ eClaimRecord.seTableDto.nettEmploymentIncome | currency:'SGD' : '' }}</td>
                <td>
                    <div *ngFor="let record of natureOfTrade">
                        <span pTooltip="{{ record.at(1) }}" tooltipPosition="bottom">{{ record.at(0) }}</span>
                    </div>
                </td>
                <td>{{ eClaimRecord.seTableDto.formBRevenue | currency:'SGD' : '' }}</td>
                <td>{{ eClaimRecord.seTableDto.formBNettTrade | currency:'SGD' : '' }}</td>
                <td>
                    <div *ngFor="let record of formBNatureOfTrade">
                        <span pTooltip="{{ record.at(1) }}" tooltipPosition="bottom">{{ record.at(0) }}</span>
                    </div>
                </td>
                <td>
                    <div *ngFor="let period of eClaimRecord.seTableDto.formBAccountingPeriod">
                        {{ period }}
                    </div>
                </td>
            </tr>
        </ng-template>
    </p-table>
</div>

<p-dialog [showHeader]="false" [(visible)]="displayCabDialog.display" [modal]="true"
    [style]="{width: '70vw'}" styleClass="cab-dialog" [draggable]="false" [resizable]="false">
    <n2-cab *ngIf="displayCabDialog.display" [csnOrNric]="csnOrNric" (cabClose)="onCloseDialog(displayCabDialog)"></n2-cab>
</p-dialog>
